body.value:
rgb(
    from var(--background-primary) r g b / 75%
  )

.canvas-color-picker-item.canvas-color-p.value:
conic-gradient(
    var(--color-red),
    var(--color-yellow),
    var(--color-green),
    var(--color-blue),
    var(--color-purple),
    var(--color-red)
  )

body.is-mobile.value:
rgb(
    from var(--background-secondary) r g b / 75%
  )

body.theme-light.value:
rgb(
    from var(--background-secondary) r g b / 90%
  )

body.is-phone .suggestion-container.value:
rgb(
    from var(--background-secondary-alt) r g b/75%
  )

body.is-tablet:not(.tablet-menu-off) .su.value:
rgb(
    from var(--background-secondary-alt) r g b/75%
  )

body.mod-windows:not(.windows-mode-off):.value:
rgb(
    from var(--background-primary) r g b / 75%
  )

rgb(
    from var(--background-secondary) r g b / 90%
  )

rgb(
    from var(--background-primary) r g b / 90%
  )
